3cf-d512799ff87f", "label": "gatheros_subscription.forms", "shape": "circle"}, {"color": "#1f77b4", "id": "272e0ed3-4cdc-5659-8624-2c53e9a6d38d", "label": "payment.helpers.payment_helpers", "shape": "circle"}, {"color": "#1f77b4", "id": "9db2953e-3917-5a45-a0f0-97420dd02316", "label": "data_cleaner.base", "shape": "circle"}, {"color": "#1f77b4", "id": "bcbf8b13-57d1-515f-b7b3-c58f0a62684e", "label": "payment.helpers", "shape": "circle"}, {"color": "#1f77b4", "id": "8079e38e-1578-52c8-8c5a-702285de75ec", "label": "gatheros_event.event_specifications", "shape": "circle"}, {"color": "#1f77b4", "id": "625672a8-901b-5e00-9f48-8eedcd04b30d", "label": "core.cli.mixins", "shape": "circle"}, {"color": "#1f77b4", "id": "49754ca6-dea6-5403-a735-0a503fef4a06", "label": "data_cleaner", "shape": "circle"}, {"color": "#1f77b4", "id": "e25c37fb-67b1-5eee-83f2-108b7606d8cd", "label": "survey.managers", "shape": "circle"}, {"color": "#1f77b4", "id": "40f09acd-1661-56f2-abca-b2a3fd96faaf", "label": "payment.exception", "shape": "circle"}, {"color": "#1f77b4", "id": "e4b5c9a9-b636-5830-9101-171844c00e09", "label": "core.model", "shape": "circle"}, {"color": "#1f77b4", "id": "73ab5bb8-6dc9-5528-ace6-be04229bc03e", "label": "mailer.services", "shape": "circle"}, {"color": "#1f77b4", "id": "fe2c0a6e-c4dd-5e7c-ad66-bbdb38ba1f41", "label": "attendance.models", "shape": "circle"}, {"color": "#1f77b4", "id": "76ff01c8-925c-5c95-af36-08a173eaf622", "label": "gatheros_event.helpers.account", "shape": "circle"}, {"color": "#1f77b4", "id": "375108d6-7a01-559e-8a70-2fd468a0c386", "label": "project.manage.urls", "shape": "circle"}, {"color": "#1f77b4", "id": "458d1625-1e19-5cb2-885a-7a5ad575566b", "label": "gatheros_subscription.views", "shape": "circle"}, {"color": "#1f77b4", "id": "f2d817ea-025a-5247-8506-b7cd96e5183d", "label": "gatheros_event.views", "shape": "circle"}, {"color": "#1f77b4", "id": "a64c263f-4452-562b-beb5-0a7d0c092343", "label": "addon.models", "shape": "circle"}, {"color": "#1f77b4", "id": "fd538fb9-167d-54c5-bfbe-21338cde7c0e", "label": "gatheros_event.helpers.event_business", "shape": "circle"}, {"color": "#1f77b4", "id": "36b5baa4-b99c-5b13-a81a-66c0bf7b4303", "label": "gatheros_event.forms", "shape": "circle"}, {"color": "#1f77b4", "id": "f705044b-5dbf-5f0b-89c6-de6be95a0166", "label": "base.models", "shape": "circle"}, {"color": "#1f77b4", "id": "e6767d5a-62c3-5121-8bee-a427c1e59f22", "label": "gatheros_event.views.mixins", "shape": "circle"}, {"color": "#1f77b4", "id": "704c49be-7d55-5035-bb60-5124564ee36a", "label": "survey.models", "shape": "circle"}, {"color": "#1f77b4", "id": "602e4d5a-2332-5348-afe2-0c104729f739", "label": "payment.models", "shape": "circle"}, {"color": "#1f77b4", "id": "c031e614-9b86-55f3-b38e-3af1315d699e", "label": "gatheros_subscription.models", "shape": "circle"}, {"color": "#1f77b4", "id": "0f806d44-ee1d-56f0-a04e-3d389100e869", "label": "gatheros_event.models", "shape": "circle"}]};

    // Calculate the degree of each node
    const nodeDegree = {};
    graphData.links.forEach(link => {
        nodeDegree[link.source] = (nodeDegree[link.source] || 0) + 1;
        nodeDegree[link.target] = (nodeDegree[link.target] || 0) + 1;
    });

    const svg = d3.select("#graph"),
        width = +svg.attr("width"),
        height = +svg.attr("height");

    const container = svg.append("g");

    // Set initial positions of nodes to the center of the canvas
    graphData.nodes.forEach(node => {
        node.x = width / 2;
        node.y = height / 2;
    });

    const simulation = d3.forceSimulation()
        .force("link", d3.forceLink().id(d => d.id).distance(graphData.nodes.length + 1000)) // Increase the distance between linked nodes
        .force("charge", d3.forceManyBody().strength(-500)) // Increase the repulsion strength
        .force("center", d3.forceCenter(width / 2, height / 2))
        .force("radial", d3.forceRadial(d => 100 - (nodeDegree[d.id] || 0) * 10, width / 2, height / 2));

    const link = container.append("g")
        .attr("class", "links")
        .selectAll("g")
        .data(graphData.links)
        .enter().append("g");

    link.append("line")
        .attr("stroke-width", 2)
        .attr("marker-end", "url(#arrowhead)");

    link.append("text")
        .attr("dy", -5)
        .attr("text-anchor", "middle")
        .text(d => d.label);

    const node = container.append("g")
        .attr("class", "nodes")
        .selectAll("g")
        .data(graphData.nodes)
        .enter().append("g");

    node.each(function (d) {
        if (d.shape === "circle") {
            d3.select(this).append("circle")
                .attr("r", 30)
                .attr("fill", d.color);
        } else if (d.shape === "rect") {
            d3.select(this).append("rect")
                .attr("width", 60)
                .attr("height", 60)
                .attr("fill", d.color)
                .attr("x", -30)
                .attr("y", -30);
        } else if (d.shape === "ellipse") {
            d3.select(this).append("ellipse")
                .attr("rx", 30)
                .attr("ry", 20)
                .attr("fill", d.color);
        } else if (d.shape === "polygon") {
            d3.select(this).append("polygon")
                .attr("points", "-30,30 30,30 0,-30")
                .attr("fill", d.color);
        }
    });

    node.append("text")
        .attr("dy", 4)
        .attr("text-anchor", "middle")
        .text(d => d.label);

    node.call(
        d3.drag()
            .on("start", dragstarted)
            .on("drag", dragged)
            .on("end", dragended)
    );

    simulation
        .nodes(graphData.nodes)
        .on("tick", ticked);

    simulation.force("link")
        .links(graphData.links);

    const zoom = d3.zoom()
        .scaleExtent([0.1, 10])
        .on("zoom", (event) => {
            container.attr("transform", event.transform);
        });

    svg.call(zoom);

    // Apply initial zoom transform to center the graph
    const initialTransform = d3.zoomIdentity.translate(width / 2, height / 2).scale(0.5);
    svg.call(zoom.transform, initialTransform);

    function ticked() {
        link.select("line")
            .attr("x1", d => {
                const dx = d.target.x - d.source.x;
                const dy = d.target.y - d.source.y;
                const dist = Math.sqrt(dx * dx + dy * dy);
                const offsetX = (dx * 30) / dist; // 30 is the radius of the source node
                return d.source.x + offsetX;
            })
            .attr("y1", d => {
                const dx = d.target.x - d.source.x;
                const dy = d.target.y - d.source.y;
                const dist = Math.sqrt(dx * dx + dy * dy);
                const offsetY = (dy * 30) / dist; // 30 is the radius of the source node
                return d.source.y + offsetY;
            })
            .attr("x2", d => {
                const dx = d.target.x - d.source.x;
                const dy = d.target.y - d.source.y;
                const dist = Math.sqrt(dx * dx + dy * dy);
                const offsetX = (dx * 30) / dist; // 30 is the radius of the target node
                return d.target.x - offsetX;
            })
            .attr("y2", d => {
                const dx = d.target.x - d.source.x;
                const dy = d.target.y - d.source.y;
                const dist = Math.sqrt(dx * dx + dy * dy);
                const offsetY = (dy * 30) / dist; // 30 is the radius of the target node
                return d.target.y - offsetY;
            });

        link.select("text")
            .attr("x", d => (d.source.x + d.target.x) / 2)
            .attr("y", d => (d.source.y + d.target.y) / 2);

        node.attr("transform", d => `translate(${d.x},${d.y})`);
    }

    function dragstarted(event, d) {
        if (!event.active) simulation.alphaTarget(0.3).restart();
        d.fx = d.x;
        d.fy = d.y;
    }

    function dragged(event, d) {
        d.fx = event.x;
        d.fy = event.y;
    }

    function dragended(event, d) {
        if (!event.active) simulation.alphaTarget(0);
        d.fx = null;
        d.fy = null;
    }
</script>
